import { useState, useEffect } from "react";
import './App.css';
import Select from "./components/select";

const App = () => {
  const [SelectData, setSelectData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:55082/api/get")
        .then(res => res.json())
        .then(data => {
          setSelectData(data)
        })
  }, [])

  return (
    <div className="App">
      <div className="dept">
        <p>系所：</p>
        <Select SelectData={SelectData}/>
      </div>
    </div>
  );
}

export default App;
